    }
    render() { 
        const {val, percentage, title} = this.props;
        return ( 
            <div className="input-field col s3">
                <input id="first_name" type="text" className="validate" readOnly value={`${val} ${percentage}`}/>
                <label className="active" > DISCOUNT </label>
            </div>
         );
    }
}
